import React, { useEffect } from 'react'

function Effect  () {
    useEffect(()=>{
        fetch('https://jsonplaceholder.typicode.com/posts')
        .then(response=>response.json())
        .then(data => console.log(response.data))
    },[]

    );






  return (
    <div>
        <h1>Post</h1>
        <ul>
            {data.map((post)=>(
                <li key={post.id}>={post.title}</li>
            ))
                
            }
            <li></li>
            <li></li>
        </ul>
      
    </div>
  )
}

export default Effect
